        React.createElement("path", { d: "M10 6h7v-.5A2.5 2.5 0 0014.5 3H10v3z", fill: primaryFill }),
        React.createElement("path", { d: "M17 13V7H3v6h14zm-7-5v4H9V8h1z", fill: primaryFill }),
        React.createElement("path", { d: "M10 17h4.5a2.5 2.5 0 002.5-2.5V14h-7v3z", fill: primaryFill }),
        React.createElement("path", { d: "M9 14H3v.5A2.5 2.5 0 005.5 17H9v-3z", fill: primaryFill }),
        React.createElement("path", { d: "M9 6V3H5.5A2.5 2.5 0 003 5.5V6h6z", fill: primaryFill }));
};
const TableCellsSplit20Filled = wrapIcon(rawSvg({}), 'TableCellsSplit20Filled');
export default TableCellsSplit20Filled;
